import React from "react";


class Row extends React.Component {


    render() {
        return (
            <tr>
                <td>Bob</td>
                <td>Lance</td>
                <td>bob@email.com</td>
                <td>1234567890</td>
                <td>Sales</td>
                <td>Sales Manager</td>
            </tr>
        )
    };
}

export default Row;
